function get_aapl() {
    var data = [];
    for(let dt in quotes) {
        if(quotes.hasOwnProperty(dt) ) {
            data.push( [ dt, quotes[dt].close ] );
        }
    }
    return data;
}

router.get('/:page', function (req, res) {
	let perPage = 8;
	let page = req.params.page || 1;
	if(!mongodb.db) {
		return res.status(200).send("Database disconnected");
	}
	let plots = [];
	for(let i = 0; i < 10; i++) {
		plots.push({
			"id": i,
			"title": "AAPL stock",
			"view_span": 100,
			"series": {
				"aapl": {
					"name": "AAPL",
        			"active": true,
					"data": get_aapl(),
				}
			},
		});
	}
	return mongodb.db.collection("foo").find({}).limit(10).toArray()
	.then((results) => {
		return res.render('main_ejs', {
			plots: plots,
			current: page,
			pages: Math.ceil(plots.length / perPage)
		});
	});
});

module.exports = router;